-- ----------------------------
-- Table structure for `bbs_article`
-- ----------------------------
DROP TABLE IF EXISTS `bbs_article`;
CREATE TABLE `bbs_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '帖子id',
  `content` longtext COMMENT '帖子内容',
  `uid` int(11) DEFAULT NULL COMMENT '用户id',
  `date` varchar(30) DEFAULT NULL COMMENT '帖子发布日期',
  `author` varchar(18) DEFAULT NULL COMMENT '帖子发布作者',
  `art_label` varchar(18) DEFAULT '' COMMENT '帖子标签（精华帖等）',
  `sid` int(11) DEFAULT NULL COMMENT '版块id',
  `reply_count` int(11) DEFAULT '0' COMMENT '回复人数',
  `title` varchar(255) DEFAULT NULL COMMENT '帖子标题',
  `praise` int(11) DEFAULT '0' COMMENT '文章点赞数',
  `blame` int(11) DEFAULT '0' COMMENT '文章倒彩数',
  PRIMARY KEY (`id`),
  KEY `aid` (`id`),
  KEY `article_user` (`uid`),
  KEY `article_section` (`sid`),
  CONSTRAINT `article_section` FOREIGN KEY (`sid`) REFERENCES `bbs_section` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `article_user` FOREIGN KEY (`uid`) REFERENCES `bbs_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8;

