-- Records of bbs_article
-- ----------------------------
INSERT INTO `bbs_article` VALUES ('39', '<p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-center\"><br></p><p>用音符承载新年的期许，用歌声传递新年的祝福，“燕岭之春”2017年新年音乐会精彩上演。岭南师范学院以新年音乐会的形式敲响了迎接2017的钟声。</p><p><br></p><p>音乐厅宾朋满座，来自广东省教育厅副厅长朱超华、师资处傅湘龙处长、教师继续教育指导中心主任廖荣辉，湛江市人大副主任朱华雄、市人民检察院检察长杨宇，市国家安全局局长李伟雄、市教育局李更盛局长等领导嘉宾，以及学校党委书记罗海鸥、校长刘明贵等校领导，与广大师生一起，共同欣赏了这一场音乐盛宴，在充满激情的交响中，共同聆听新春临近的铿锵脚步。</p><p><br></p><p>“要把每一位师生员工的音符汇聚成岭南师范学院建设发展的宏大壮丽的乐章，将学校的办学事业推向高潮，共同开创岭南师范学院的美好未来。”刘明贵校长代表学校向全校的师生员工及家属，向全体离退休老同志，向广大校友和长期以来一直关心、支持岭南师院建设发展的各级领导和各界朋友表示崇高敬意和衷心感谢，并送上新年的祝福！</p>', '4', '2018-04-25 13:23', '王五', '精华', '17', '2', '岭南师范学院新年音乐会奏响“燕岭之春”', '2', '0');
INSERT INTO `bbs_article` VALUES ('40', '<p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-center\"><span style=\"color: rgb(136, 136, 136);\">论坛会现场</span></p><p class=\"ql-indent-7\"><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\">12月24日，我校召开“人生境界与学术追求”暨劳承万先生从教60周年论坛。来自中国政法大学、中山大学、上海交通大学、华中师范大学等著名高校的专家学者聚首岭师，畅谈教育人生，追求学术创新，共叙师友情谊。学校党委书记罗海鸥，我校康德-牟宗三研究所劳承万教授，学校党委原副书记刘海涛教授、原副校长刘周堂教授及文传学院部分教授和老师50多人出席了论坛。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\">劳承万教授对校领导的关心和多位专家学者的支持表示感谢。他回顾了60年来学术追求的艰辛曲折历程，表示人生境界最重要的是时刻保持“平常心”，一切坎坷磨难都应以坦然的心态面对。他强调，无论做学术还是教学，首要是安身立命，保持良好的身体素质。劳承万说，自己虽退休，但还心系和关注文传学院的发展，希望各位校友一如既往地关注和支持学校发展。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\">罗海鸥对劳承万教授从教60周年表示祝贺、对百忙之中抽空前来出席论坛的专家学者表示欢迎和感谢。罗海鸥指出，在我们学校前身——雷阳书院诞辰380周年、学校从事师范教育112周年、老校长谭平山诞辰130周年之际，尤其是省市共建岭南师范学院，在大力提升学科建设、队伍建设和创新平台建设的关键时刻，举办劳承万教授从教60周年的活动意义重大而深远。罗海鸥深情地回顾了劳承万从教60周年的艰辛、苦难但又不失尊严本质的人生历程，认为劳承万先生不管在教书育人还是学术研究上都处处体现着追求卓越的精神。60年来，他培养和影响了一大批人才，创造性地构建了“美学三论”，成为我国著名学者；他创造了中文系（现文传学院）上世纪九十年代的辉煌，影响和带动了我校升本后教学和科研水平的快速提升。如今，耄耋之年的劳承万教授仍在潜心学术、教书育人。他学通中西、劳心力行，育人教化、静水流深，是值得我们敬重和学习的好榜样。学校为有劳承万这样的老师而骄傲。</span></p>', '3', '2018-04-25 15:34', '李四', '', '17', '0', '劳承万教授从教60周年，师友相聚共话人生境界与学术追求', '2', '0');
INSERT INTO `bbs_article` VALUES ('41', '<p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">今年中国年度汉字是 “规”。</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">老规矩是民族的立身之本；新规矩是新时代新要求。</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">规矩，方圆之至也，无规矩不成方圆。</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\" class=\"ql-size-huge\">征集内容</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">自己或以宿舍、部门为单位，手持A4纸或黑板一个手绘艺术字并拍照，另加一段简短描述。这个字必须是最能代表你这一年的汉字，可以是某个小目标，或者是某个心情，某个经历，甚至是对新年的展望，把它写在小黑板上或者A4纸上。</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\" class=\"ql-size-huge\">征集方式</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">发微博@岭南师范学院或官博官微后台回复，</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">标明昵称和长短号。</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\" class=\"ql-size-huge\">征集时间</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">即日起到12月29号</span></p>', '3', '2018-04-25 15:42', '李四', '', '17', '1', '征集|新年送福，秀出岭师人年度汉字', '0', '0');
INSERT INTO `bbs_article` VALUES ('47', '<p><strong>我读书越多</strong></p><p><strong>书籍就使我和世界越接近</strong></p><p><strong>生活对我也变得越加光明和有意义</strong></p><p class=\"ql-align-right\"><strong>---高尔基</strong></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\">今天又是一年一度的世界读书日，悄悄地问一句：你今天读书了吗？还没有？别急，小编今天不仅带来了岭师图书馆2017年的年度数据，还送上学校第十三届读书月活动具体安排噢。</span></p><p><br></p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span style=\"color: rgb(62, 62, 62); background-color: rgb(255, 255, 255);\">在世界读书日之际，学校图书馆、校读书协会联合开展以“新时代 新师范 新阅读”为主题的第十三届读书月活动，除了有各种大赛、讲座培训，还有电影巡演、广州湾图片展览、</span><strong style=\"color: rgb(62, 62, 62); background-color: rgb(255, 255, 255);\">特别还书日</strong><span style=\"color: rgb(62, 62, 62); background-color: rgb(255, 255, 255);\">、十佳读者评选等活动，活动丰富多彩，欢迎广大师生参与！</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong style=\"color: rgb(171, 25, 66);\">世界读书日</strong></p><p class=\"ql-align-center\"><strong style=\"color: rgb(171, 25, 66);\">约上小伙伴们</strong></p><p class=\"ql-align-center\"><strong style=\"color: rgb(171, 25, 66);\">一起遨游在书海的世界里吧</strong></p><p><br></p><p><br></p>', '3', '2018-04-25 16:16', '李四', '精华', '17', '0', '读书日| 新时代 新师范 新阅读', '0', '0');
INSERT INTO `bbs_article` VALUES ('48', '<p>	广东省教育厅近期发布了<span style=\"color: rgb(255, 0, 0);\">《关于公费定向培养粤东西北中小学教师的实施意见（征求意见稿）》</span>，提出从2018年开始，面向粤东西北地区71个县（市、区）定向培养本专科、硕士研究生学历层次教师，毕业后到定向范围学校（含村小、教学点）任教不少于6年，以加快全省教师队伍建设，培养一批“下得去、留得住、教得好、有发展”的乡村教师。目前《意见》正在向社会公开征求意见，意见反馈截止日期为4月8日。</p><p><span style=\"color: rgb(255, 0, 0);\">岭南师范学院在《意见》中被列为承担公费定向培养粤东西北中小学教师培养院校之一，未来将按省统一部署招收公费定向培养师范生。</span>公费定向培养师范生在培养院校学习期间免缴学费、住宿费、军训服装费、教材资料费和实习实践费和发放生活补助费等，其中生活补助费标准为每人每年8000元。该政策的出台，学校发展迎来了新机遇，必将有力助推学校“新师范”建设，进一步加快学校建设特色鲜明的高水平师范大学的步伐。下面跟着岭南君一起看看《意见》的主要内容吧！</p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">一、目标任务</strong></p><p class=\"ql-align-justify\">	为进一步精准补充乡村教师，优化教师资源配置，提升广东省教师队伍的整体素质，按照“自愿报名、择优录取、公费培养、定向从教、限期服务”的原则，<span style=\"color: rgb(255, 0, 0);\">自2018年起，每年为粤东西北中小学培养一批高质量的学前教育、特殊教育、小学教育（全科）和义务教育阶段学校音乐、体育、美术等紧缺学科教师，为普通高中培养专业突出、底蕴深厚的研究生学历层次教师。</span></p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">二、培养政策规定</strong></p><p class=\"ql-align-justify\">	（一）培养模式。1.采取初中起点五年一贯制专科层次的模式，培养幼儿园教师(学前教育专业，下同)。2.采取高中起点四年制本科层次的模式，培养幼儿园教师、小学全科教师（小学教育专业，下同）、义务教育阶段学校体育、音乐、美术等紧缺学科（体育教育专业、音乐学专业、美术学专业，下同）、特殊教育教师（特殊教育专业，下同）。3.采取本科（或同等学力）起点两（或三）年制全日制硕士研究生学历层次的模式，培养普通高中教师。4．探索初中起点六年制本科层次的模式，培养小学全科教师以及义务教育阶段学校体育、音乐、美术等紧缺学科和特殊教育教师。</p><p class=\"ql-align-justify\">	（二）定向就业范围。为粤东西北地区71个县（市、区）（详见附件1）定向培养教师，幼儿园	教师、小学全科教师和紧缺学科教师面向乡镇（不含县城所在镇街）及乡镇以下农村公办学校（含村小、教学点和幼儿园）培养，特殊教育教师、普通高中教师面向县域内相关学校培养。</p><p class=\"ql-align-justify\">	（三）培养院校。根据省内师范院校（或以师范教育为主的院校，下同）的培养规模和能力，<span style=\"color: rgb(255, 0, 0);\">承担公费定向培养粤东西北中小学教师培养院校为华南师范大学、广东技术师范学院、</span><strong style=\"color: rgb(255, 0, 0);\">岭南师范学院</strong><span style=\"color: rgb(255, 0, 0);\">、韩山师范学院、广东第二师范学院、广州大学、韶关学院、嘉应学院、惠州学院、肇庆学院和广东省外语艺术职业学院、广东茂名幼儿师范专科学校、湛江幼儿师范专科学校等。</span><span style=\"color: rgb(0, 0, 0);\">省教育厅每年将按照全省定向培养需求计划和师范院校培养的能力水平，对培养院校进行适当调整。</span></p><p class=\"ql-align-justify\">	（四）培养机制。由培养院校与定向培养计划来源地共同制订人才培养方案，按照德育为先、能力为重、面向基层、强化实践的原则，联合开展培养工作。</p><p class=\"ql-align-justify\">	（五）培养经费。<span style=\"color: rgb(255, 0, 0);\">省级公费定向培养计划所需费用由省级财政统筹安排，在生均拨款基础上，按照本专科学历层次每生每年2万元标准，硕士研究生学历层次每生每年3万元标准安排给各培养高校，专项用于公费定向培养师范生在培养院校学习期间免缴学费、住宿费、军训服装费、教材资料费和实习实践费和发放生活补助费等，其中生活补助费标准为每人每年8000元。</span>在国家和省有关资助政策规定的范围内，公费定向培养师范生不重复享受减免学费和生活补助政策，其他与在校生享受同等待遇。毕业上岗后，公费定向培养师范生不享受到农村从教上岗退费政策。</p><p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"data:image/gif;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVQImWNgYGBgAAAABQABh6FO1AAAAABJRU5ErkJggg==\"></span></p><p><strong style=\"color: rgb(0, 0, 0);\">三、培养计划编制</strong></p><p class=\"ql-align-justify\">	（一）县（市区）申报计划。经各县级政府同意，县级教育行政部门会同机构编制、人力资源社会保障和财政部门依据定向范围学校教师补充需求情况，研究申报公费定向培养教师需求计划报地市教育部门。</p><p class=\"ql-align-justify\">	（二）地市初审汇总。各地市教育部门会同机构编制、人力资源社会保障和财政部门对所辖各县的需求计划进行审核汇总，于每年11月前报省教育厅。</p><p class=\"ql-align-justify\">	（三）审核下达计划。根据各地申报定向培养需求的实际情况，省教育厅结合各师范院校（或以师范教育为主的院校）的培养能力、区域平衡等因素，动态调整，统筹确定年度公费定向培养专业、培养计划数和培养院校。在年度公费定向培养计划总额内，统筹编制各地各招生类型的年度公费定向培养计划，并分别纳入全省当年初中起点本专科招生、普通高考本科招生、全日制硕士研究生招生的总计划，下达到各培养院校，并由省招生办公室向社会公布。</p><p class=\"ql-align-justify\">	（四）院校编制招生计划。各培养院校根据省教育厅下达的公费定向培养教师专项计划，在教育部“全国普通高校招生来源计划网上管理系统”上编制各招生类型各科类各专业分区域招生来源计划，招生计划性质对应为“地方公费师范生”。初中起点本专科生源计划和高中起点本科定向培养教师专项计划，根据省教育厅的审核结果，由省招生办公室分别在“省中招服务平台”和“省普通高校招生来源计划编制系统”上置入。</p><p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"data:image/gif;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVQImWNgYGBgAAAABQABh6FO1AAAAABJRU5ErkJggg==\"></span></p><p><strong style=\"color: rgb(0, 0, 0);\">四、报考对象和条件</strong></p><p><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(0, 0, 0);\">报考对象仅限大陆或内地户籍人员，且应符合以下条件：</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（一）忠诚党和人民教育事业，热爱教育工作，自愿报考定向培养师范专业，承诺在校学习不转学、不转专业，且保证毕业后服从计划来源地安排，到定向范围学校（含村小、教学点）任教不少于6年。</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（二）身体健康，参照《普通高等学校招生体检工作指导意见》、《广东省教师资格申请人员体格检查标准（2013年修订版）》和《广东省事业单位公开招聘人员体检通用标准》等相关要求体检合格。</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（三）报考定向培养考生应符合当年度相应招考的报考条件，其中报考初中起点本专科层次考生，成绩应达到当年生源地示范性普通高中录取最低分数线的应届初中毕业生；报考高中起点本科层次考生，高考成绩应达到当年省招生委员会公布的公费定向培养教师专项计划录取最低分数线；报考教育硕士全日制研究生层次考生，应具有大学本科毕业学历或同等学力及符合相关高校录取要求。</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（四）报考音乐、美术、体育类高中起点本科专业的考生，需参加普通高校招生统一考试的术科统考。考生高考成绩应达到当年省招生委员会公布的公费定向培养教师专项计划录取文化科和术科最低分数线。</span></p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">五、招录方式</strong></p><p class=\"ql-align-justify\">	（一）招收初中毕业生起点各类专业本专科师范生，依据初中学业水平考试成绩和综合素质评价情况等录取，与示范性高中同批次录取，由地市招办在有关高校下达的本地市招生限额内组织实施。&nbsp;</p><p class=\"ql-align-justify\">	（二）招收高中起点各类专业本科师范生，依据高考成绩和高中学业水平考试成绩，参考高中的综合素质评价情况，由省招生办公室在普通高考的本科提前录取批次中单设志愿，单独划线，单独投档录取。	</p><p class=\"ql-align-justify\">	（三）招收教育硕士全日制研究生，按照全国硕士研究生招生考试有关规定进行录取。</p><p class=\"ql-align-justify\">	（四）积极探索综合评价、多元录取模式，根据师范生培养和用人单位需求组织测试，并将测试结果作为录取的依据。</p><p class=\"ql-align-justify\">	（五）严格规范招生程序，切实加强组织领导，规范考生考试报名、考试组织实施以及招生录取管理等工作，确保程序公开、结果公正。</p><p class=\"ql-align-justify\">	（六）公费定向培养考生被录取后不能退档，不能转学，不能转专业，否则取消当年录取资格。考生入学前应与培养院校和培养计划来源地县政府三方签订公费定向培养协议（样本详见附件2）。考生在签订协议时如未满18周岁，须由考生及其法定监护人共同签订协议。不签订协议的，取消其录取资格。</p><p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"data:image/gif;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVQImWNgYGBgAAAABQABh6FO1AAAAABJRU5ErkJggg==\"></span></p><p><strong style=\"color: rgb(0, 0, 0);\">六、培养质量管控</strong></p><p class=\"ql-align-justify\">	为确保公费定向培养质量，培养院校要修订人才培养方案，优化课程体系。加强师德养成教育，培养乡村教育情怀；创新人才培养模式，提高信息化教学能力；加强师范技能训练，强化实践育人环节。加强与各地级市教育行政部门、中小学密切合作，协同育人。强化质量意识，加强学籍管理和教学管理。</p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">公费定向培养师范生在校期间出现下列情形之一的，经培养院校研究、计划来源所在地同意，取消其公费定向培养资格，并按规定退还已享受的教育培养经费，由培养院校负责据实核算。</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（一）违反培养院校纪律，受到学校记过以上处分的；</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（二）未能在基本修业年限内获取毕业证书或学位证书的；</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（三）毕业前未能通过相应学段（或学科）教师资格证书所有科目的考试；</span></p><p class=\"ql-align-justify\">	<span style=\"color: rgb(0, 0, 0);\">（四）因个人原因（因病休学除外）中断学业的。</span></p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">七、就业安排及履约管理</strong></p><p class=\"ql-align-justify\">	根据公费定向培养协议书和当年就业政策要求，在公费定向培养师范生毕业时，由培养计划来源地教育行政部门采用面试或组织考察形式进行招录，按照“适合、急需”的原则安排工作岗位，并督促用人单位与公费定向培养师范生签定聘用合同，按照事业单位新进人员规定办理相关手续。</p><p class=\"ql-align-justify\">	公费定向培养师范生要自觉履行在培养前签订的协议要求，坚守服务期约定，努力做教育改革的奋进者、教育扶贫的先行者、学生成长的引导者，为教育事业发展积极作贡献。在规定服务期内，公费定向培养师范生不得以升学、调动为由不履行限期服务约定，鼓励其通过自学考试或函授、在职攻读研究生等形式提升学历。</p><p class=\"ql-align-justify\">	各地负责辖区内公费定向培养师范生的履约管理，在服务期内可安排其在定向范围内的学校间进行交流轮岗，并负责建立诚信档案，记载违约记录。对未能履行协议规定的，各地负责按规定追缴其退还所享受的教育培养经费，并缴纳该费用50%的违约金，其违约行为记入个人诚信档案，予以公布</p>', '3', '2018-04-25 16:39', '李四', '', '17', '0', '师范生有福啦！以后读岭南师院定向培养生将免费', '0', '0');
INSERT INTO `bbs_article` VALUES ('49', '<p class=\"ql-align-justify\">4月9日上午，湛江市暨赤坎区2018年大学生征兵工作启动仪式在我校举行。参与仪式的人员有湛江军分区冯振鹏副司令员、湛江市政府副秘书长洪涛、相关军地领导、征兵工作人员和各驻湛高校师生代表。岭南师范学院兰艳泽副校长出席仪式，并鼓励岭师学子积极响应祖国号召，投笔从戎，建设国防，为“强国梦”和“中国梦”贡献岭师力量。</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(20, 20, 20);\">会上，市征兵班主任、军分区副司令员冯振鹏介绍湛江市征兵的基本情况，市征兵办副主任、军分区动员处处长韦斌和大家重温了习近平给南开大学新入伍同学的回信精神，我校信息学院15级的退役大学生代表冯柏荣分享了军旅生活及所感所获。市征兵办在现场还开展了咨询报名活动。</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(20, 20, 20);\">据了解，</span><strong style=\"color: rgb(20, 20, 20);\">从2010年以来至今，岭南师院一共向部队输送了139名大学生，</strong><span style=\"color: rgb(20, 20, 20);\">学生入伍以来不忘初心，牢记使命，荣获多项功勋奖励，充分彰显了岭师的特殊品质。</span></p><p class=\"ql-align-center\"><img src=\"data:image/gif;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVQImWNgYGBgAAAABQABh6FO1AAAAABJRU5ErkJggg==\"></p><p><strong style=\"background-color: rgb(255, 255, 255);\">参军入伍优惠政策多多</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(20, 20, 20);\">近年来，党中央、国务院、中央军委高度重视大学生征兵工作，先后出台一系列优惠政策，具体有哪些？一起看↓↓↓</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">看到政策是不是很心动呢，不急让小编给你捋一捋在校报名流程：</span></p><p><span style=\"color: rgb(0, 0, 0);\">1、在全国征兵网上登陆填写相关内容，学费补偿国家助学贷款代偿信息填写参见“申请表填写说明”，《大学生预征对象登记表》按要求填写。填写完成后，生成《大学生预征对象登记表》(以下简称《登记表》)、《大学生预征对象登记表》存根、《高校学生应征入伍学费补偿国家助学贷款代偿申请表》(以下简称《申请表》)三个文件的电子版材料，进行材料的初核（具体见所在学校通知）；</span></p><p><span style=\"color: rgb(0, 0, 0);\">2、核对无误后，学生打印《登记表》一份，《申请表》两份。其中《登记表》中的“主要经历”一项需要本人手写清楚，“就读学校对本人在校期间表现及文化程度鉴定意见”一项需请辅导员或学院工作负责人填写并签名盖章。《申请表》第二页“申请人签字”栏处由本人签名。</span></p><p><span style=\"color: rgb(0, 0, 0);\">3、将填写好的《登记表》和《申请表》以及户籍复印件、身份证复印件、6张一寸标准照片交至校武装部。户籍关系如果已迁入学校的，需到保卫处户籍科开具。</span></p><p><span style=\"color: rgb(0, 0, 0);\">4、在读证明、《登记表》存根由校武装部统一出具、打印。《申请表》后续审核手续由校武装部与学校相关部门协调，统一办理。</span></p><p><span style=\"color: rgb(0, 0, 0);\">5、《高校学生应征入伍学费补偿国家助学贷款代偿申请表》。&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">如有疑问，可拨打学校征兵工作站电话：3182482</span></p><p><br></p><p><strong style=\"background-color: rgb(255, 255, 255);\">将爱国之心化为报国之行</strong></p><p><br></p><p>还记得大一军训时英姿飒爽、挺拔正直的学生教官吗？他们之中，除了普通同学，也有退伍的军人。让我们听听他们说的，看看军营的生活又是怎么样的吧！</p><p><br></p><p class=\"ql-align-justify\"><strong>冯柏荣</strong>，是我校信息工程学院15级电气1班的学生，是岭南师范学院2017级新生军训团二营的副营长。2014年9月入伍。</p><p class=\"ql-align-justify\">两年时光可以改变许多，所以在入伍前，冯柏荣考虑了很久，在未来与学业之间反复踌躇。最终他仍然选择去实现军营梦。两年军营生活的锤炼，令冯柏荣成长了不少，对于未来的规划也越发清晰。退伍后，他选择回校继续学业，并作为新生军训教官在新生军训团担任副营长。&nbsp;</p><p class=\"ql-align-justify\">“回想两年的部队生活，历历在目，还记得第一次抚摸真枪时那沉重而冰冷的手感；还记得第一次实弹射击时的紧张和激动；还记得第一次紧急集合时的急促和茫然。”在征兵启动仪式上，冯柏荣激情澎湃的演讲令现场不少师生为之打动。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">“我很自豪能把人生最美好的年华献给了祖国。”冯柏荣表示，部队是一个大熔炉，把五湖四海的人汇聚成一个大集体，接触到了很多人，见识到很多不知道的事。在新生军训训练之余，他常常向新同学讲起以往当兵的经历。军营里那一排排整齐的营房，曾经一起全副武装长途奔袭的战友；站岗放哨的日日夜夜......这些刻骨铭心的喜怒哀乐，这些美好的点点滴滴，都珍藏为他生命中最宝贵的回忆。</p><p class=\"ql-align-justify\">当兵很苦，当兵很酷。有人说当兵后悔两年，不当兵后悔一辈子。而冯柏荣指出，他当兵的两年从不后悔，因为有苦有甜，才是生活的滋味。不管师弟师妹是否参军入伍，都要谨慎考虑，但在军营生活一定会有收获！</p><p><br></p><p><br></p><p><strong>曾华宙</strong>，是我校数学与统计学院16数本5班的学生，是岭南师范学院2017级数计院新生军训团连长。2014年9月入伍。</p><p class=\"ql-align-justify\">他带着家人的期盼参军入伍，并希望能通过参军来改变自己，变得更好。军营生活很苦，但曾华宙不后悔。他认为，当初选择军人这一身份是正确的，因为参军入伍，报效祖国，投身国防是他们每一个士兵的理想。军营生活的两年里，他懂得了什么是家，什么是国，懂得了一个军人肩上该有的责任和义务。</p><p class=\"ql-align-justify\">“当兵累不累，想想革命老前辈；当兵酷不酷，想想红军长征两万五。”一句古老的顺口溜，是曾华宙想对师弟师妹们说的心声。作为过来人，他看到了国家和政府在不断改善有关大学生参军入伍的优惠政策。</p><p class=\"ql-align-justify\">“大学生参军入伍优惠政策是国家对大学生士兵的重视，国家的经济发展需要更强大的国防来保障，而现代化军事武装需要更多的高素质人才。”曾华宙认为，过去伟大的革命前辈做出了巨大的牺牲与贡献，现在应当轮到当代青年学子了，勇挑重担，甘于奉献，为国防献出个人之力。</p><p><br></p>', '3', '2018-04-25 17:00', '李四', '', '17', '0', '将爱国心化为报国行！大学生携笔从戎优惠政策多多', '0', '0');
INSERT INTO `bbs_article` VALUES ('50', '<p><strong>合作项目概况</strong></p><p><br></p><p class=\"ql-align-justify\">大学生暑期赴美带薪社会实践活动在我校已经成功举办了九年。该活动为学生提供了一个踏上美国国土、体验美国生活文化、提高英语能力、进入美国企业与美国同事以及来自其他国家的国际学生并肩工作的机会。该活动所提供的J-1签证让每个实习生在完善的美国劳动制度保障下进行实习工作。这给予学生全面提高综合能力的锻炼机会，开阔了学生的国际视野，增强了学生的就业竞争力，同时也减轻了赴美实习生的经济负担。</p><p class=\"ql-align-justify\">大学生暑期赴美带薪社会实践实习项目是一个非常成熟的美国政府文化交流项目。项目在中国大陆推广之前，已经在欧洲、美洲及亚洲其他国家和地区成功运作了50余年，每年都有数万学生利用他们的暑假，持J-1签证进入美国企业进行为期8-12周的短期实习。并利用实习之余的时间，在美境内旅游或实地体验美国生活，了解美国风土人情。 截至到2017年8月报名参加暑期赴美带薪实习项目的学生分布已经遍及全国近300多所学校，其中成功赴美学生人数已超16000人。学生们归国后也获得了社会、学校以及家长等各方面极高评价。</p><p class=\"ql-align-justify\"><br></p><p><strong>合作方简介</strong></p><p><br></p><p class=\"ql-align-justify\">作为国内最正规、最具规模的推广大学生赴美带薪实习项目的机构，中国人民对外友好协会下属中国对外友好合作服务中心（以下简称：中外服），以推动国际合作为宗旨，立足于美国国务院法案，并在此基础上深入理解，在华推广J-1（交流访问学者签证）类文化交流项目，致力于让更多的中国学生亲身踏上美国国土，真实地感受美国先进的科技与人文环境。中外服给予每个申请者最安全的保障，这也是学校选择项目合作伙伴时的最重要的考量。</p><p class=\"ql-align-justify\"><br></p><p><strong>项目参与学生反馈：</strong></p><p class=\"ql-align-center\">▼</p><p><strong>外国语学院 大一 粟慧珏</strong></p><p><strong>【实习岗位】客房服务员</strong></p><p class=\"ql-align-justify\">如果不是来到这里，不会遇见那么多善良可爱的人们，不会体会到亲自掌管柴米油盐的琐碎，不会看到不同于国内的独特的生活方式，不会知道原来不管异乡的风景多美，最眷恋的依然是自己的祖国，不会了解到来自各国的人们对于中国的看法原来和新闻上看到的并不一样。</p><p class=\"ql-align-justify\">从开始着手办理各种出国的资料，置办行李，到现在照顾自己的衣食住行，再到制定旅游计划，这整一个过程都在逼自己做事情要想的更加周全，处理问题更加细心。我从来没想到我真的能成功来到这里，并且到目前为止一切进展顺利，想说有些事情看起来好像很难很遥不可及，但是当自己真的行动起来，努力去争取时，它其实并没有那么难，而当你真正做到的时候，心里会有一份小自豪。</p><p class=\"ql-align-center\">▼</p><p><strong style=\"color: rgb(11, 1, 1);\">文传学院 大三 伍浩文</strong></p><p><strong>【实习岗位】厨师助理</strong></p><p class=\"ql-align-justify\">两个月里，从洗碗到可以参与食材准备，到可以做美食呈上餐桌，再到现在成为另外一家新店的三大主厨之一，其他两位分别是71岁的当地日本人和在美国生活了9年的西班牙人，我负责的是招牌。做梦都没有想到在我人生中还有这样一出戏。</p><p class=\"ql-align-justify\">只要开始，就会获得。若不开始，便无法启蒙，无法体验广阔山河，万物奥秘。执行力才是最关键的，摆脱低质量的努力，建立高质量的努力方式，才是人生进阶的第一步。要想升职，先升值。未来要想站上更高的位置，那就只能努力提升自我价值，这才是王道。</p><p class=\"ql-align-justify\">日子太快，梦想很瘦，要学的知识太多，想做的事情也太多。我给自己一个季度的时间，我可以有遗憾，但别后悔。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-center\">▼</p><p><strong>生命科学与技术学院 大三 张静雯</strong></p><p><strong>【实习岗位】客房服务</strong></p><p class=\"ql-align-justify\">Summer Work and Travel,工作是这个项目的重中之重。housekeeper虽然只是一份小小的工作，但是却教会我很多很多。无论什么工作，都要用我们的耐心与认真去对待，因此每次被inspector表扬与肯定的时候，都会由衷地开心与满足，觉得被别人肯定，是一件很幸福的事情呀。</p><p class=\"ql-align-justify\">我工作和生活的地方，是位于美国弗吉尼亚州的威廉姆斯堡。这里的人都很亲切，像这个小堡一样美好，教会的叔叔阿姨经常会给我们组织活动，或者邀请我们去他们家吃饭，宿舍的邻居也经常会分享美食给我们，很暖很暖。</p><p class=\"ql-align-justify\">别人的，看再多，都只是故事，只有自己的，那才是经历。这个项目，虽然是一个实习的项目，但参加的目的不在赚多少钱，更多的是你个人心态的改变与心智的成熟，更多的是你在面对事情与困难时你的应变能力与处理事情的能力，这些是用多少钱都无法衡量的。因此，我很感恩，我有这样一个，让自己成长的机会。</p><p class=\"ql-align-center\"><br></p><p><strong>2018年项目接受报名啦！</strong></p><p><br></p><p><strong>2018年暑期赴美带薪社会实践项目信息：</strong></p><p><br></p><p><strong>宣讲会：</strong></p><p><strong>时间：</strong>11月29日（周三）晚上19：30</p><p>&nbsp;&nbsp;&nbsp;&nbsp;11月30日（周四）晚上19：30</p><p><strong>地点：</strong>教三&nbsp;208室</p><p><br></p><p><strong>项目报名：</strong></p><p><strong>通知链接：</strong></p><p>http://202.192.128.61/wsb/News_Show.asp?id=1012</p><p>（可点击文末“阅读原文”进入）</p><p><strong>报名截止时间：</strong>12月25日</p><p><br></p><p><strong>联系方式：</strong></p><p><strong>校内手续咨询：</strong>国际交流与合作处</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;					&nbsp;李老师 0579-3182717</p><p><strong>项目详情咨询：</strong>中外服</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;					&nbsp;廖老师 18500377285</p>', '5', '2018-04-25 17:07', '张三', '', '18', '0', '2018年暑期赴美带薪社会实践项目接受第二轮报名啦！', '0', '0');
INSERT INTO `bbs_article` VALUES ('51', '<p>11月19日，第十五届“挑战杯”全国大学生课外学术科技作品决赛结果揭晓。岭南师范学院参赛的三件作品共获得1项二等奖、2项三等奖和1项累进创新银奖。本次闯进国赛项目数量、获奖奖项和累进创新奖获奖等级均创历史新高，首次实现在全国比赛中哲社类、自然科学类和科技发明制作三大类项目均有获奖。</p><p><br></p><p class=\"ql-align-justify\">获得二等奖和累进创新银奖的作品是由数计学院李明山、张渝曼、潘妙巧、刘秀敏、黄鑫、林意等同学完成，周效良、李晓培教授指导的《几类具有非线性发生率SIR传染病模型的动力学性质研究》 。</p><p><br></p><p class=\"ql-align-justify\">获得三等奖的2件作品分别是：由文传学院陈晓文、冼业娟、吴印才、徐怡、黄海等同学完成，林捷老师指导的作品《红土地上的兵马俑：雷州石狗文化旅游发展的新路径研究报告》&nbsp;；由物理学院尹柱辉、杨雄飞、胡君怡、梁仕儒、黄恒烽、余天兵等同学完成，张军、廖峻老师指导的作品《基于红外热成像技术构建电饭煲三维温度场的关键技术研究》&nbsp;。</p><p><br></p><p>今年的“挑战杯”工作得到了学校领导的高度重视，形成了以校团委为组织单位，相关部处和院系大力支持、指导老师与学生积极参与的良好局面。学校党委副书记黄达海亲自率领参赛队伍赴上海参赛，在师生的共同努力下，取得了历届全国“挑战杯”中的最好成绩。</p><p><br></p><p class=\"ql-align-justify\">据悉，本届“挑战杯”大赛，参加初赛的共有32个省（区、市）、1739所高校的28594件作品（不含港澳地区）；经过层层选拔，共有303所高校的715件作品以及来自香港科技大学、香港中文大学、澳门大学等11所著名港澳高校的40件参赛作品进入决赛。下一届“挑战杯”赛将由北京航空航天大学承办。</p><p><br></p>', '3', '2018-04-25 17:24', '李四', '', '17', '0', '厉害了！第十五届“挑战杯”全国赛传捷报，岭师四项奖创新高', '0', '0');
INSERT INTO `bbs_article` VALUES ('52', '<p class=\"ql-align-justify\"><span style=\"color: rgb(20, 20, 20);\">11月18日至19日，由岭南师范学院、台湾师范教育学会、台湾教育大学系统共同主办的第七届海峡两岸教师教育高端论坛在我校国际会议厅举行。来自海峡两岸41所高校70多位校长和专家教授齐聚一堂，围绕“教师教育新境界――规划与发展”这一主题，共讨新时代的“新师范”建设。</span></p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">开幕有高度</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-justify\">我校校长刘明贵教授，台湾教育大学系统总校长、台湾师范教育学会理事长吴清基教授在论坛上致辞并作主旨报告。论坛开幕式由我校副校长黄崴主持。台中教育大学校长王如哲，上海师范大学原校长张民选，韶关学院校长廖益，安徽师范大学副校长朱家存，台湾师范大学教育学院院长陈学志，台湾师范大学名誉教授、我校特聘教授吴武典等海峡两岸教育专家出席了开幕式。开幕式上，我校教育科学学院与台湾师范大学教育学院进行了合作签约。</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\">“在新时代下，办好师范和教师教育是每一个所师范院校要思考的问题，也是这次论坛的目的。”刘明贵表示，党的十九大对我国的教育事业提出了新的要求，广东省教育厅率先提出了建设“新师范”的概念，这预示着广东乃至全国各地的师范教育将迎来新一轮的改革，这是国家对教育的要求，也是广大民众对教育的需求。</p><p class=\"ql-align-justify\">刘明贵认为，“新师范”主要体现在新形势、新理念和新模式三个方面。新形势是广大人民群众对优质教育资源日益增长的需求，是现代信息技术对教师教育加深的渗透和融合，是国内教师教育领域日益深化的改革；新理念提出要树立高师教育服务、引领基础教育，实现职前培训与职后培训相统一，高师教育与基础教育有机贯通，将师范教育真正转型为教师教育，使高师教育与基础教育形成相融共生、相伴成长的有机共同体；互联网时代下的人才培养新模式应根据学生志趣调整教育教学的方式方法，提高教学效率和效益。</p><p class=\"ql-align-center\"><img src=\"data:image/gif;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVQImWNgYGBgAAAABQABh6FO1AAAAABJRU5ErkJggg==\"></p><p class=\"ql-align-justify\">“在这里，我们感受到两岸一家亲和浓厚的人情味！”吴清基表达了来到大陆的亲切之情与我校的深厚情谊，高度肯定了我校“景在那里，教育就在那里”的校园建设理念，赞赏我校争当粤台教育文化交流合作先锋、广东优质教师教育基地、南方特教人才培养重镇、先进教育思想理论创新中心、广东地方政府教育政策咨询驻库的战略定位。他指出，在“一带一路”、工业4.0时代、2025中国制造等政策和高端计划下需要更高级的人才来推动国家的建设发展。师范院校培育师资，是开启人才的工程，更要适度时代发展的需要，教会学生学会认知、学会做事、学会与人相处、学会成就自己、学会适应变迁。</p><p><br></p><p><strong>&nbsp;</strong><strong style=\"color: rgb(20, 20, 20);\">闭幕有成果</strong></p><p><br></p><p class=\"ql-align-justify\">11月19日上午，为期一天半的第七届海峡两岸教师教育高端论坛在我校国际会议厅闭幕。台湾师范大学名誉教授、我校特聘吴武典教授主持闭幕式。我校刘明贵校长出席闭幕式，对参加本次论坛的海峡两岸专家学者、论坛工作人员等致以衷心感谢，并预祝2018年第八届海峡两岸教师教育高端论坛在台北市立大学顺利举行。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">“这次论坛大家畅所欲言，达到了预期目标，加强了两岸的交流合作，推进了两岸教育事业发展的双赢。”台湾教育大学系统总校长、台湾师范教育学会理事长吴清基教授对此次论坛的成功举行做出了充分肯定。他认为国家要富强，一定要有好的教育来培养好的人才。教育教师发展要重视培养好教师，只有好教师才能培养好的下一代。他强调，这次论坛为教师教育提供了智慧，新时代的教师教育要推进终生教育、通识教育、协同创新，提升教师的核心素养和核心能力。</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-justify\">“这次论坛的选题非常好，既适应当前整个教师教育改革发展方向又与世界的教师教育发展的大势相吻合。”我校副校长黄崴致闭幕辞，认为此次论坛具有“四高”特点：一是参与度高。论坛齐聚海峡两岸41所高校70多位校长和专家教授参加，地区覆盖面广；二是水平高。论坛紧紧围绕中心议题展开激烈探讨，围绕党的十九大对我国的教育事业提出的新要求，提出了具体的针对性的教育发展改革问题；三是水准高。专家代表在整个会议期间所表达的观点既在宏观层面审计了国家教育教师的发展走向，如怎样建立中国一流的师范教育，又从国际视角出发探讨教育发展难题，如怎么样培养学生的创新能力等问题；四是效率高。两岸学者在短短一天半的时间中就教师教育发展的中心议题畅所欲言，内容丰富，提出很多有意的建议和意见，提供了思考、研究和解决问题的方向和对策。</p><p class=\"ql-align-justify\">黄崴指出，此次论坛的圆满举行巩固了海峡两岸教师教育高端论坛的成果，增进海峡两岸的深厚友谊，具有重要的现实意义和长远意义，为进一步推动海峡两岸教育改革和经济社会发展起到了积极作用。他希望我校教育科学学院与台湾师范大学教育学院签署的合作协议能够落地生根，真正生效。</p><p class=\"ql-align-center\"><br></p><p><span style=\"color: rgb(20, 20, 20);\">本次论坛形式多样、内容丰富。一天半时间安排了大会主题报告16个、分组报告28个，海峡两岸教育专家对新时代的“新师范”建设和师范教育的的新境界开展大讨论，这将是教育思想的大碰撞、教育智慧的大对话。</span></p><p><br></p>', '3', '2018-04-25 17:25', '李四', '', '17', '0', '抢鲜！海峡两岸教育专家齐聚岭师探讨“新师范”建设', '0', '0');
INSERT INTO `bbs_article` VALUES ('53', '<p class=\"ql-align-justify\">“金笔生花嘉华年，岭师出彩著文章。”学生记者是学校新闻宣传工作的一支有生力量，他们积极投身校园新闻实践，撰写了大批新闻作品，多角度、全方位地展示了学校的良好形象，为学校的改革发展稳定营造了良好的舆论氛围。为凝聚更多优秀的学生参与学校的新闻宣传工作，培育一批优秀的校园媒体精英并发挥其榜样示范作用，鼓舞广大学生记者再接再厉“讲好岭师故事，传递岭师好声音”，创作出更多反映学校特色的好作品，现决定开展<span style=\"color: rgb(230, 0, 0);\">首届“金笔岭师”评选表彰活动</span>。</p><p><br></p><p><strong>培育校媒精英，引领新闻导向</strong></p><p><br></p><p><strong style=\"background-color: rgb(254, 236, 175); color: inherit;\">活动时间：</strong></p><p><br></p><p><strong>2017年12月­­­—2018年03月</strong></p><p><br></p><p><strong style=\"background-color: rgb(254, 236, 175); color: inherit;\">评选对象：</strong></p><p><br></p><p><strong>学校新闻中心学生记者，各二级单位新闻宣传机构学生骨干。</strong></p><p><br></p><p><strong style=\"background-color: rgb(254, 236, 175); color: inherit;\">表彰项目：</strong></p><p><br></p><p><strong>（一）金笔奖</strong></p><p><strong>（二）十佳新闻写作奖</strong></p><p><strong>（三）十佳新闻影像奖</strong></p><p><strong>（四）十佳新媒体创作奖</strong></p><p><strong style=\"background-color: rgb(254, 236, 175); color: inherit;\">报名时间：</strong></p><p><br></p><p><strong style=\"color: rgb(255, 41, 65);\">即日起—12月11日</strong></p><p><strong style=\"background-color: rgb(254, 236, 175); color: inherit;\">活动联系人：</strong></p><p><br></p><p><strong>梁老师，3183234</strong></p><p><br></p><p><strong>评选标准</strong></p><p><br></p><p><strong>（一）总体要求</strong></p><p class=\"ql-align-justify\">1. 思想政治表现好，坚持四项基本原则，热爱祖国，拥护中国共产党的基本路线、方针和政策。坚持马克思主义新闻观，在新闻实践中自觉与党中央保持一致。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">2. 热爱校园新闻宣传工作，按照学校新闻宣传工作的规范，积极参加学校的新闻实践，恪守新闻职业道德，有正确的新闻舆论观、世界观、人生观和价值观。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">3. 有强烈的集体荣誉感和奉献精神，责任心强，服从大局，勤奋刻苦，团结师友，无违纪处分现象，无失实报道，无抄袭行为。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">4. 在《岭南师院报》、学校新闻文化网、校园新媒体平台等校园媒体及市级以上媒体上发表一定数量的有关学校中心工作和反映校园生活的新闻作品，参评者须提交2000字以上的个人工作经验总结和第一作者的代表作和一定数量的作品目录（在各个奖项的具体要求中有说明）。</p><p class=\"ql-align-justify\"><br></p><p><strong>（二）具体要求</strong></p><p class=\"ql-align-center\"><strong>金笔奖</strong></p><p class=\"ql-align-justify\">坚守学生记者的使命和担当，积极投身学校的新闻宣传工作，业绩突出，任职期间在校内外媒体平台发表作品累计80篇以上。参评者提交两篇第一作者代表作和作品目录20条。</p><p class=\"ql-align-center\"><strong>十佳新闻写作奖</strong></p><p class=\"ql-align-justify\">积极参与校园新闻的采写，一年内在校内外媒体平台发表新闻作品30篇以上。参评者提交两篇第一作者的代表作和作品目录10条。</p><p class=\"ql-align-center\"><strong>十佳新闻影像奖</strong></p><p class=\"ql-align-justify\">积极参与学校新闻摄影摄像，一年内发表新闻摄影作品30条以上，或制作过一定数量展示学校形象和反映校园文化生活的影视作品。摄影类提交五张代表作和作品目录10条，影像类至少提交一篇影视脚本或创意说明。</p><p class=\"ql-align-center\"><strong>十佳新媒体创作奖</strong></p><p class=\"ql-align-justify\">在学校新媒体建设中表现突出，参与校园各级公众号运营，一年内发表原创作品10篇以上。参评者提交两篇第一作者的代表作和作品目录5条。</p><p><br></p>', '3', '2018-04-25 17:26', '李四', '', '17', '0', '金笔生花，岭师出彩：首届“金笔岭师”评选征集重磅推出', '0', '0');
INSERT INTO `bbs_article` VALUES ('54', '<p class=\"ql-align-justify\"><span style=\"color: rgb(0, 0, 0);\">你听说了吗？2017年12月15日，由广东省教育厅主办、岭南师范学院承办的广东省2018届高校毕业生供需见面会（粤西地区专场）将在岭南师院新区田径体育场举行，届时会有近400家企业从全国各地汇聚而来，为众多毕业生学子准备了上万的岗位，接下来就让我们走进这场求职盛会吧！</span>	</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 129, 36); color: rgb(255, 255, 255);\">1</strong></p><p class=\"ql-align-justify\"><strong>时间地点</strong></p><p><strong style=\"color: rgb(63, 63, 63);\">时间：2017年12月15日 09：00-16：00</strong></p><p><strong style=\"color: rgb(63, 63, 63);\">地点：岭南师范学院新区田径体育场</strong></p><p><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 129, 36); color: rgb(255, 255, 255);\">2</strong></p><p class=\"ql-align-justify\"><strong>入场须知</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">1、</strong><span style=\"color: rgb(63, 63, 63);\">岭南师范学院参会学生凭校园卡或有效证件入场；</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">2、</strong><span style=\"color: rgb(63, 63, 63);\">校外参会学生凭三件：“有效证件、个人简历、就业推荐表”，从学生入口处入场；</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">3、</strong><span style=\"color: rgb(63, 63, 63);\">学生凭电子入场劵扫码进场。电子入场劵领取途径：关注“岭南师院就业”公众号、“账号绑定”、“返回主页”、“就业信息”、“招聘会”、“广东省2018届高校毕业生供需见面会（粤西地区专场）”（二维码见底部图片二维码）；</span></p><p class=\"ql-align-justify\"><strong>（以上三种入场方式学生根据需要选择一种即可）</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">4、</strong><span style=\"color: rgb(63, 63, 63);\">会场签到入口旁将展示会场平面示意图、岗位一览表海报，供参会人员查看；</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">5、</strong><span style=\"color: rgb(63, 63, 63);\">我们将会在招聘会会场设立“企业文化展示区”、“后勤保障服务区”、“供需‘双选’服务区”以及“精准就业服务区”，为各用人单位、毕业生提供以下服务：</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(63, 63, 63);\">（1）“企业文化展示区”（毕业生就业服务驿站）为用人单位提供企业文化的现场展示及视频宣传；</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(63, 63, 63);\">（2）“后勤保障服务区”可以为毕业生提供复印、简历修改等就业自助服务工作、并设有医疗服务点和安全保障点；</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(63, 63, 63);\">（3）“精准就业服务区”将会有专职老师为毕业生提供政策咨询、简历诊断、职业测评和心理咨询等服务；</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">6、</strong><span style=\"color: rgb(63, 63, 63);\">与会当天天气温和，建议面试者穿着正装，大方得体，展现个人气质；面试建议穿正装+皮鞋/小高跟。女生最好备着一双平底鞋，舒服的鞋子很重要的哦；</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">7、</strong><span style=\"color: rgb(63, 63, 63);\">由于近期天气变化较大，请各参会学生密切关注天气，根据实际情况准备衣物及雨具。</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">8</strong>、<span style=\"color: rgb(63, 63, 63);\">应急电话</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(63, 63, 63);\">就业中心：0759-3174603</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(63, 63, 63);\">保卫处：0759-3183446</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(255, 129, 36); color: rgb(255, 255, 255);\">3</strong></p><p class=\"ql-align-justify\"><strong>路线一览</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(255, 41, 65);\">（1）湛江市区</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(61, 170, 214);\">广东海洋大学毕业生</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">湖光校区：</strong><span style=\"color: rgb(63, 63, 63);\">乘928路 → 13路、9路&nbsp;→&nbsp;15路&nbsp;、9路&nbsp;→&nbsp;13路、9路&nbsp;→&nbsp;2路&nbsp;到岭南师院下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">霞山校区：</strong><span style=\"color: rgb(63, 63, 63);\">乘火车西站专线、11路、1路、12路、22路、2路到岭南师院站下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">海滨校区</strong><span style=\"color: rgb(63, 63, 63);\">：乘16路、2路、22路到岭南师院站下车，47路到寸金公交站下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(61, 170, 214);\">广东医科大学毕业生</strong><span style=\"color: rgb(61, 170, 214);\">：</span><span style=\"color: rgb(63, 63, 63);\">乘12路、火车西站专线、11路、2路、22路、16路到岭南师院站下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(61, 170, 214);\">广东海洋大学寸金学院毕业生</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">旧校区：</strong><span style=\"color: rgb(63, 63, 63);\">乘23路、912b路、22路、16路、12路、56路、807路、1路到岭南师院站下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">新校区：</strong><span style=\"color: rgb(63, 63, 63);\">乘6路、3路&nbsp;→&nbsp;6路、14路&nbsp;→&nbsp;13路、14路&nbsp;→&nbsp;1路到岭南师院站</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(255, 41, 65);\">（2）湛江市外</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(61, 170, 214);\">火车站</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">火车西站、火车南站：</strong><span style=\"color: rgb(63, 63, 63);\">乘火车西站专线到岭南师院站下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(61, 170, 214);\">汽车站</strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">海田车站：</strong><span style=\"color: rgb(63, 63, 63);\">乘56路、33路、25路到岭南师院站下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">麻章车站：</strong><span style=\"color: rgb(63, 63, 63);\">乘22路、16路、33路、2路、12路、11路、23路到岭南师院站下车</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(63, 63, 63);\">汽车南站：</strong><span style=\"color: rgb(63, 63, 63);\">乘火车西站专线、11路到岭南师院下车</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(63, 63, 63);\"><span class=\"ql-cursor\">﻿</span></span></p><p class=\"ql-align-center\"><span style=\"color: rgb(0, 0, 0);\">这可是有四百家用人单位参加的招聘会</span></p><p class=\"ql-align-center\"><span style=\"color: rgb(0, 0, 0);\">这可是有上万个就业岗位的招聘会</span></p><p class=\"ql-align-center\"><span style=\"color: rgb(0, 0, 0);\">这可是一场和以往不太一样的招聘会</span></p><p class=\"ql-align-center\"><span style=\"color: rgb(0, 0, 0);\">我们已严阵以待，期待你的到来！</span></p><p class=\"ql-align-center\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;机会总是留给有准备的人</span></p><p class=\"ql-align-center\"><span style=\"color: rgb(0, 0, 0);\">请带上你的简历和自信</span></p><p><br></p><p class=\"ql-align-center\"><strong style=\"color: rgb(0, 0, 0);\">12月15日9：00—16：00</strong></p><p class=\"ql-align-center\"><strong style=\"color: rgb(0, 0, 0);\">&nbsp;岭南师院雷阳区田径体育场</strong></p><p class=\"ql-align-center\"><span style=\"color: rgb(0, 0, 0);\">我们不见不散</span></p><p class=\"ql-align-justify\"><br></p><p><br></p>', '3', '2018-04-25 18:10', '李四', '置顶', '18', '0', '毕业供需重磅来袭：400家用人单位上万岗位等你挑选！', '0', '0');
INSERT INTO `bbs_article` VALUES ('55', '<p>今日，由广东省教育厅主办、我校承办的广东省2018届高校毕业生系列供需见面活动（粤西地区专场）在新区田径场举行。有别于往届校园招聘会，此次的粤西专场是省教育厅首次将毕业生供需见面会交由我校承办。共有近400家企事业单位进场招聘，为毕业生提供了13000个工作岗位，吸引了8000多名毕业生进场应聘。</p><p><br></p><p>兰艳泽副校长出席见面会并致辞，她感谢省教育厅对我校的重视与肯定，对各用人单位表示热烈欢迎。她表示岭南师院毕业生“好用、顶用、耐用”，希望到场各用人单位喜得良才，鼓舞应届毕业生们积极谋求职场的第一份工作。</p><p><br></p><p>会场分设了“供需’双选’服务区”、“校企文化展示区”、“就业精准服务区”、“后勤保障服务区”等四个功能区、九个服务站。由知名企业举办现场宣讲会及企业视频展播；一线就业指导老师“坐诊”为毕业生提供“线上线下”就业指导服务。场面之壮观，让小编带你一起去看看！</p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">这是企业招聘是最关注的几个问题，如何回答这些问题也成为企业的考量标准。但如今企业招聘的“套路”越来越深，应聘者往往穷于应付，答不到要点。但是这些企业却告诉你，保持初心我们就会懂你。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\">除了应届毕业生，我们的看官、为这场招聘会保驾护航的志愿者们和后勤服务人员也都在这场招聘会中扮演着自己的角色。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\">“先来看看招聘会的现场，”15机电的吴同学现场研究了各摊位前的海报，认真对比后，发现要找一份专业对口的工作并不容易，于是这更坚定了她的考研意愿。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\">“这种供需见面会挺好的，能搭建起企业与学生直接交流的平台。这种在校的集体应聘与单独去应聘相比，能缓解紧张，从而更好地展示自己。”来自英国的留学生维也纳与来自越南的留学生阮德旺一同为这种供需见面会点赞，认为目前中国发展前景大，希望将来能在中国高校任教。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(62, 62, 62);\"><span class=\"ql-cursor\">﻿</span>看到校园招聘会一角摆着“以梦为马不负韶华”的字样，岭南君不禁感慨大学时间已过半，其实不管你是步履匆匆还是与时光静候漫步前行，只要心中有理想，手里有实在货就不畏惧人山人海，不管在哪里都可以脱颖而出，也不管你是怎样地平凡，总会遇到你的伯乐。</span></p>', '3', '2018-04-25 18:14', '李四', '精华', '18', '0', '岭师首场省级供需见面会举行，岭南君带你直击现场！', '0', '0');
INSERT INTO `bbs_article` VALUES ('57', '<p><span style=\"color: rgb(0, 0, 0);\">工作职责：</span></p><p><span style=\"color: rgb(0, 0, 0);\">1、VR领域相关新技术调研和原型验证；</span></p><p><span style=\"color: rgb(0, 0, 0);\">2、公司VR相关产品前端功能和交互研发；&nbsp;</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">职位要求：</span></p><p><span style=\"color: rgb(0, 0, 0);\">1、名校毕业，计算机相关专业；&nbsp;&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2、具备扎实的计算机基础，对数据结构和算法设计有充分理解 ；</span></p><p><span style=\"color: rgb(0, 0, 0);\">3、熟悉HTML、CSS及JavaScript等Web前端技术</span></p><p><span style=\"color: rgb(0, 0, 0);\">4、有好奇心，热爱互联网，对互联网产品和技术有浓厚的兴趣，热衷于追求技术极致与创新 ；</span></p><p><span style=\"color: rgb(0, 0, 0);\">5、具有良好的沟通能力和团队合作精神、优秀的分析问题和解决问题的能力 。</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">简历投递：</span></p><p><span style=\"color: rgb(0, 0, 0);\">有意者发送简历至邮箱:zhengweizhong@lianjia.com;</span></p><p><span style=\"color: rgb(0, 0, 0);\">【邮件名称格式】：姓名-学校及专业-毕业年级(如19级)-最快入职时间-可实习时长</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">关于VR实验室：</span></p><p><span style=\"color: rgb(0, 0, 0);\">链家网VR 实验室成员均来自国际名校或顶尖公司，致力于通过技术重新定义3D世界。我们的团队正在开发端到端的硬件和软件解决方案，能够构建高质量的虚拟现实场景。我们的技术将被应用在超过7000万套真实房屋VR实景模型的创建中，并被数千万家庭使用。&nbsp;</span></p>', '3', '2018-04-25 18:30', '李四', '', '18', '0', '链家网VR实验室招聘前端研发工程师', '0', '0');
INSERT INTO `bbs_article` VALUES ('58', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">暴力解法在这种极端情况下会超时。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">Example：{ 1, 9, 8, 7, 6, 5, 4, 3, 2}</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">每一次的遍历只能让数组规模减1，所以总共要遍历（n-1）次，而每次遍历的规模为整个数组长度，即n+(n-1)+(n-2)+(n-3)+……+2</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">所以总的时间复杂度为O(n2/2)</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">非暴力解法如下。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">plantHeight[]是表示植株长度的数组。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">numOfPlants表示植株的数目。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">f(i):记录着位置i会在第几天被拔出。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">p[i]:记录着从第i个位置往前数，找到的第一个比a[i]小的元素的位置。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">若a = {1，2，9，5，7，6}， 则p = {-1，0，1，1，3，3}</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">当遍历完一次数组a, 得到数组p，只需要O(n)的时间复杂度.</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">m[i]:记录着从i位置到p[i]处的区间内当中的植株最晚会被拔出的时间，也就是最大的f值</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">m[i]=max(f[j])&nbsp;&nbsp;j∈(p[i]，i)&nbsp;&nbsp;//此处为开区间</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">推理得，第i个位置的植株要等待区间(p[i]，i)内的植株都被拔除后，才会被拔除。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">因此，f[i] = m[i] +1;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">java代码如下：</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">import java.io.*;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">import java.lang.Math;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">class test&nbsp;&nbsp;{</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">public static void main (String[] args) {</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int[] a = {3,6,9,8};</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int[] b = {3,2,1,2,3,2,1,5,4,3,2,1,5,4};</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int[] c = {2,1};</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int[] d = {1,5,4,3,5,4,5,3};</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int[] e = {1, 7, 6, 5, 2, 6, 5, 4, 6, 5, 6, 3};</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int A = numberOfDays(a,a.length);</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int B = numberOfDays(b,b.length);</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int C = numberOfDays(c,c.length);</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int D = numberOfDays(d,d.length);</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;int E = numberOfDays(e,e.length);</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(A+\"&nbsp;&nbsp;\"+B+\"&nbsp;&nbsp;\"+C+\"&nbsp;&nbsp;\"+D+\"&nbsp;&nbsp;\"+E);</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">}</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">public static int numberOfDays(int[] plantHeight,int numOfPlants) {</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;int[] p = new int[numOfPlants];</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;int[] m = new int [numOfPlants];</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;int[] f = new int [numOfPlants];</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;p[0] = -1;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;m[0] = 0;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;f[0] = 0;// 表示不会被移除</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;for(int i = 1 ;i &lt; numOfPlants;i++){</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;if(p[i] == -1) continue;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;int j = i-1;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;int max = 0;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;while(j &gt;= 0){</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;if(plantHeight[j] &lt; plantHeight[i]){</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;p[i] = j;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;m[i] = max;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;f[i] = max+1;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;break;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;} else {</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;max = Math.max(f[j],max);//当前区间（p[j],j]中最大的f[j]值</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;j = p[j]; //继续搜索，跳到p[j]位置</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;}</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;}</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;if(j==-1)p[i] = j;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;}</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;int res = 0;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;for(int k = 0; k &lt; numOfPlants;k++){</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;res = Math.max(res,f[k]);</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;}</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;return res;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;}</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">}</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">用了另一个楼主的测试用例，跑出来的答案是：2，4，0，4，4</span></p>', '5', '2018-04-25 18:31', '张三', '', '19', '0', '微软拔树题O(n)的解法 -Java版', '0', '0');
INSERT INTO `bbs_article` VALUES ('59', '<p>阿里内推编程测试，是一个最优化组合的问题，没有头绪，求大神。</p><p><strong style=\"background-color: transparent;\">题目描述：</strong></p><p>某玩具店内有编号为1-N的卡片多张，且有玩具M种（第i种的价格为Pi）。每种玩具的包装盒内，有编号固定且连续的卡片（Xi至Yi, 1&lt;=Xi&lt;=Yi&lt;=N）各一张。为了促销开展“集卡”活动。活动内容为集齐N种卡片，且对每种卡片有数量要求（规定编号为i的卡片需要Ni张），即可换得优惠券。请问客户至少花多少钱买这些玩具可以得到一张优惠券。（假设M和N均不大于100）</p><p><strong style=\"background-color: transparent;\">输入：</strong></p><p>第一行有两个整数N, M，表示卡片的最大编号和玩具的种类。接下来一行中包含N个非负整数，表示活动需要集齐每种卡片的张数。接下来的M行中每行包含三个整数X, Y, P分别表示这种玩具中卡片编号的起始号、终止号和价格。假定每种玩具都是无限多的。</p><p><strong style=\"background-color: transparent;\">输出：</strong></p><p>仅包含一个整数，表示买玩具得到优惠券最少花的费用。</p><p><strong style=\"background-color: transparent;\">输入范例：</strong></p><p>4 2</p><p>1 3 2 2</p><p>1 2 2</p><p>2 4 5</p><p><strong style=\"background-color: transparent;\">输出范例：</strong></p><p>12</p><p>（即买2个5元的，1个2元的）</p><p><br></p>', '3', '2018-04-25 19:03', '李四', '', '19', '0', '阿里编程测验算法，组合优化最小', '0', '0');
INSERT INTO `bbs_article` VALUES ('60', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">求版内大神指点一下我的代码，我实在想不出到底哪里有问题</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">为了找到自己满意的工作，牛牛收集了每种工作的难度和报酬。牛牛选工作的标准是在难度不超过自身能力值的情况下，牛牛选择报酬最高的工作。在牛牛选定了自己的工作后，牛牛的小伙伴们来找牛牛帮忙选工作，牛牛依然使用自己的标准来帮助小伙伴们。牛牛的小伙伴太多了，于是他只好把这个任务交给了你。&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">输入描述:</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">每个输入包含一个测试用例。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">每个测试用例的第一行包含两个正整数，分别表示工作的数量N(N&lt;=100000)和小伙伴的数量M(M&lt;=100000)。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">接下来的N行每行包含两个正整数，分别表示该项工作的难度Di(Di&lt;=1000000000)和报酬Pi(Pi&lt;=1000000000)。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">接下来的一行包含M个正整数，分别表示M个小伙伴的能力值Ai(Ai&lt;=1000000000)。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">保证不存在两项工作的报酬相同。</span></p><p><br></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">输出描述:</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">对于每个小伙伴，在单独的一行输出一个正整数表示他能得到的最高报酬。一个工作可以被多个人选择。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">输入例子1:</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">3 3&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">1 100&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">10 1000&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">1000000000 1001&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">9 10 1000000000</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">输出例子1:</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">100&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">1000&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">1001</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">我的代码</span></p><pre class=\"ql-syntax\" spellcheck=\"false\">#include&lt;iostream&gt;\n#include&lt;vector&gt;\n#include&lt;algorithm&gt;\n\nusing namespace std;\nstruct workst{\n  int need, pay;\n  workst():need(0), pay(0){}\n  workst(int a): need(a), pay(0){}\n  bool operator&lt;(const workst &amp;a) const{\n    return this -&gt; need &lt; a.need;\n  }\n};\nint main() {\n  int N, M;\n  cin &gt;&gt;N &gt;&gt; M;\n  vector&lt;workst&gt; job(N);\n  vector&lt;int&gt; level(M);\n  for(int i = 0; i &lt; N; ++i) {\n    cin &gt;&gt; job[i].need &gt;&gt; job[i].pay;\n  }\n  for(int i = 0; i &lt; M; ++i)\n    cin &gt;&gt; level[i];\n  sort(job.begin(), job.end());//给输入工作按照所需能力之从小到大排序\n  for(int i = 0; i &lt; M; ++i) {\n    workst man(level[i]);\n    auto it = upper_bound(job.begin(), job.end(), man);//找到第一个做不了的工作\n    if(it == job.begin()) cout &lt;&lt; 0;\n    vector&lt;workst&gt; temp(job.begin(), it);\n//按照收益从大到小排序\n    sort(temp.begin(), temp.end(), [](workst &amp;job1, workst &amp;job2){return job1.pay &gt; job2.pay;});\n    cout &lt;&lt; temp[0].pay &lt;&lt; endl;\n  }\n}\n</pre><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">结果段错误:您的程序发生段错误，可能是数组越界，堆栈溢出（比如，递归调用层数太多）等情况引起</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">case通过率为20.00%</span></p>', '5', '2018-04-25 19:07', '张三', '', '19', '0', '网易今年的题目，一直显示段错误', '0', '0');
INSERT INTO `bbs_article` VALUES ('61', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">感觉很有意思<img src=\"http://bbs.cloud.icybee.cn/img/ubb/ema/3.gif\" alt=\"ema3\">，求最大公约数g的同时，求出ax+by = g的整数解x，y</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">扩展欧几里德算法&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">欧几里德辗转相除法的基本原理：gcd(a,b)=gcd(b,a%b)&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">所以： ax + by = g //g=gcd(a,b)&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">==&gt; bx’ + (a%b)y’ = g&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">==&gt; bx’ + (a-a/b*b)y’ = g&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">==&gt; ay’ + b(x’-a/b*y’) = g&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">==&gt; x=y’、y=x’-a/b*y’ //迭代式&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">根据迭代式，可以在欧几里德辗转相除法求 a,b 的最大公约数时，同时计算 ax+by=g 的一&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">个整数解！&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">int gcd(int a,int b)&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">{&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">if(b==0) returen a;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">int g=gcd(b,a%b);&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">return g;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">}&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">int exgcd(int a,int b,int &amp;x,int &amp;y)&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">{&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">if(b==0) { x=1; y=0; return a;} // g*1=g&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">int xx,yy;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">int g=exgcd(b,a%b,xx,yy);&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">x=yy;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">y=xx-(a/b)*yy;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">return g;&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">}</span></p>', '5', '2018-04-25 19:08', '张三', '', '19', '0', '扩展欧几里得算法', '0', '0');
INSERT INTO `bbs_article` VALUES ('62', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">题目：</span><a href=\"https://leetcode.com/problems/4sum/description/\" target=\"_blank\" style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 255);\">https://leetcode.com/problems/4sum/description/</a></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">我思路是仿照3sum，但对于这个测试实例&nbsp;&nbsp;nums=[0,0,0,0,0,0] target=0，就是有4个值相同并且恰好这四个值之和就等于target，我写的代码对于这种情况都跳过了，但是不跳过的话又会得到重复的结果，怎么把这种case通过呢？求大佬指点。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">另外：对于k-sum问题的时间复杂度是n的k-1次方吗？</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">代码如下:</span></p><pre class=\"ql-syntax\" spellcheck=\"false\">class Solution:\n    def fourSum(self, nums, target):\n        \"\"\"\n        :type nums: List[int]\n        :type target: int\n        :rtype: List[List[int]]\n        \"\"\"\n        res=[]\n        nums.sort()\n\n        for i in range(len(nums)-3):\n            if nums[i]==nums[i-1] and i&gt;0:\n                continue\n            for j in range(i+1,len(nums)-2):\n                if nums[j]==nums[j-1] and j&gt;i:\n                    continue\n                l,r=j+1,len(nums)-1\n                while l&lt;r:\n                    s=nums[i]+nums[j]+nums[l]+nums[r]\n                    if s&lt;target:\n                        l+=1\n                    elif s&gt;target:\n                        r-=1\n                    else:\n                        res.append([nums[i],nums[j],nums[l],nums[r]])\n                        while l&lt;r and nums[l]==nums[l-1]:\n                            l+=1\n                        while l&lt;r and nums[r]==nums[r-1]:\n                            r-=1\n                        l+=1\n                        r-=1\n        return res\n</pre><p><br></p><p>--</p><p><br></p><p><img src=\"data:image/png;base64,\"></p>', '5', '2018-04-25 19:16', '张三', '', '19', '0', 'LeetCode 4sum问题', '0', '0');
