INSERT INTO `bbs_article` VALUES ('64', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">问题如下：</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">假定给你一个网络图（包含节点和边），怎么去评估它随着时间的变化？</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">比如你的微信社交网络图，画出朋友关系图（包含朋友的朋友），找到对于它的变化的拓扑衡量方式</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">写一段简单的代码来计算它的拓扑变化（不仅是节点和边的总数变化，也要包含它们之间的关系）</span></p><p><br></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">求各位大佬指点，感激不尽<img src=\"http://bbs.cloud.icybee.cn/img/ubb/ema/23.gif\" alt=\"ema23\"></span></p>', '3', '2018-04-25 19:27', '李四', '', '19', '0', '求各位大佬看下这道图论算法题，对小弟很重要的面试题', '0', '0');
