INSERT INTO `bbs_article` VALUES ('67', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">江城子</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">丝竹悠悠落海棠，</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">春华尽，夜微凉。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">调琴引曲，煮酒青梅香。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">与君千里邀明月，</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">离别苦，相思长。&nbsp;</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">忽忆旧年旧同窗，</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">雨未眠，影成双。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">执棋吟荇，只道是寻常。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">韶华依旧匆匆去，</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">恨已至，夏未央。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;（11年旧作）</span></p>', '5', '2018-04-25 19:44', '张三', '', '21', '1', '愿录旧字，以念闺阁词笔', '0', '0');
INSERT INTO `bbs_article` VALUES ('68', '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">最近发生了一些事，想起了鲁迅的这篇《纪念刘和珍君》</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">（写于一九二六年 四月一日）</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">原文：</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">一</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">中华民国十五年三月二十五日，就是国立北京女子师范大学为十八日在段祺瑞执政府前遇害的刘和珍杨德群两君开追悼会的那一天，我独在礼堂外徘徊，遇见程君，前来问我道，“先生可曾为刘和珍写了一点什么没有？”我说“没有”。她就正告我，“先生还是写一点罢；刘和珍生前就很爱看先生的文章。”</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">这是我知道的，凡我所编辑的期刊，大概是因为往往有始无终之故罢，销行一向就甚为寥落，然而在这样的生活艰难中，毅然预定了《莽原》全年的就有她。我也早觉得有写一点东西的必要了，这虽然于死者毫不相干，但在生者，却大抵只能如此而已。倘使我能够相信真有所谓“在天之灵”，那自然可以得到更大的安慰，——但是，现在，却只能如此而已。 </span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">可是我实在无话可说。我只觉得所住的并非人间。四十多个青年的血，洋溢在我的周围，使我难于呼吸视听，那里还能有什么言语？长歌当哭，是必须在痛定之后的。而此后几个所谓学者文人的阴险的论调，尤使我觉得悲哀。我已经出离愤怒了。我将深味这非人间的浓黑的悲凉；以我的最大哀痛显示于非人间，使它们快意于我的苦痛，就将这作为后死者的菲薄的祭品，奉献于逝者的灵前。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">二</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">真的猛士，敢于直面惨淡的人生，敢于正视淋漓的鲜血。这是怎样的哀痛者和幸福者？然而造化又常常为庸人设计，以时间的流驶，来洗涤旧迹，仅使留下淡红的血色和微漠的悲哀。在这淡红的血色和微漠的悲哀中，又给人暂得偷生，维持着这似人非人的世界。我不知道这样的世界何时是一个尽头！</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">我们还在这样的世上活着；我也早觉得有写一点东西的必要了。离三月十八日也已有两星期，忘却的救主快要降临了罢，我正有写一点东西的必要了。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\"> </span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">三</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">在四十余被害的青年之中，刘和珍君是我的学生。学生云者，我向来这样想，这样说，现在却觉得有些踌躇了，我应该对她奉献我的悲哀与尊敬。她不是“苟活到现在的我”的学生，是为了中国而死的中国的青年。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">她的姓名第一次为我所见，是在去年夏初杨荫榆女士做女子师范大学校长，开除校中六个学生自治会职员的时候。其中的一个就是她；但是我不认识。直到后来，也许已经是刘百昭率领男女武将，强拖出校之后了，才有人指着一个学生告诉我，说：这就是刘和珍。其时我才能将姓名和实体联合起来，心中却暗自诧异。我平素想，能够不为势利所屈，反抗一广有羽翼的校长的学生，无论如何，总该是有些桀骜锋利的，但她却常常微笑着，态度很温和。待到偏安于宗帽胡同，赁屋授课之后，她才始来听我的讲义，于是见面的回数就较多了，也还是始终微笑着，态度很温和。待到学校恢复旧观，往日的教职员以为责任已尽，准备陆续引退的时候，我才见她虑及母校前途，黯然至于泣下。此后似乎就不相见。总之，在我的记忆上，那一次就是永别了。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">四</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">我在十八日早晨，才知道上午有群众向执政府请愿的事；下午便得到噩耗，说卫队居然开枪，死伤至数百人，而刘和珍君即在遇害者之列。但我对于这些传说，竟至于颇为怀疑。我向来是不惮以最坏的恶意，来推测中国人的，然而我还不料，也不信竟会下劣凶残到这地步。况且始终微笑着的和蔼的刘和珍君，更何至于无端在府门前喋血呢？</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">然而即日证明是事实了，作证的便是她自己的尸骸。还有一具，是杨德群君的。而且又证明着这不但是杀害，简直是虐杀，因为身体上还有棍棒的伤痕。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">但段政府就有令，说她们是“暴徒”！</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">但接着就有流言，说她们是受人利用的。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">惨象，已使我目不忍视了；流言，尤使我耳不忍闻。我还有什么话可说呢？我懂得衰亡民族之所以默无声息的缘由了。沉默呵，沉默呵！不在沉默中爆发，就在沉默中灭亡。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">五</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">但是，我还有要说的话。 </span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">我没有亲见；听说她，刘和珍君，那时是欣然前往的。自然，请愿而已，稍有人心者，谁也不会料到有这样的罗网。但竟在执政府前中弹了，从背部入，斜穿心肺，已是致命的创伤，只是没有便死。同去的张静淑君想扶起她，中了四弹，其一是手枪，立仆；同去的杨德群君又想去扶起她，也被击，弹从左肩入，穿胸偏右出，也立仆。但她还能坐起来，一个兵在她头部及胸部猛击两棍，于是死掉了。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">始终微笑的和蔼的刘和珍君确是死掉了，这是真的，有她自己的尸骸为证；沉勇而友爱的杨德群君也死掉了，有她自己的尸骸为证；只有一样沉勇而友爱的张静淑君还在医院里呻吟。当三个女子从容地转辗于文明人所发明的枪弹的攒射中的时候，这是怎样的一个惊心动魄的伟大呵！中国军人的屠戮妇婴的伟绩，八国联军的惩创学生的武功，不幸全被这几缕血痕抹杀了。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">但是中外的杀人者却居然昂起头来，不知道个个脸上有着血污……</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">六</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">时间永是流驶，街市依旧太平，有限的几个生命，在中国是不算什么的，至多，不过供无恶意的闲人以饭后的谈资，或者给有恶意的闲人作“流言”的种子。至于此外的深的意义，我总觉得很寥寥，因为这实在不过是徒手的请愿。人类的血战前行的历史，正如煤的形成，当时用大量的木材，结果却只是一小块，但请愿是不在其中的，更何况是徒手。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">然而既然有了血痕了，当然不觉要扩大。至少，也当浸渍了亲族；师友，爱人的心，纵使时光流驶，洗成绯红，也会在微漠的悲哀中永存微笑的和蔼的旧影。陶潜说过，“亲戚或余悲，他人亦已歌，死去何所道，托体同山阿。”倘能如此，这也就够了。</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">七</span></p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">我已经说过：我向来是不惮以最坏的恶意来推测中国人的。但这回却很有几点出于我的意外。一是当局者竟会这样地凶残，一是流言家竟至如此之下劣，一是中国的女性临难竟能如是之从容。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">我目睹中国女子的办事，是始于去年的，虽然是少数，但看那干练坚决，百折不回的气概，曾经屡次为之感叹。至于这一回在弹雨中互相救助，虽殒身不恤的事实，则更足为中国女子的勇毅，虽遭阴谋秘计，压抑至数千年，而终于没有消亡的明证了。倘要寻求这一次死伤者对于将来的意义，意义就在此罢。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">苟活者在淡红的血色中，会依稀看见微茫的希望；真的猛士，将更奋然而前行。</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">呜呼，我说不出话，但以此记念刘和珍君！</span></p>', '5', '2018-04-25 19:48', '张三', '', '21', '0', '鲁迅《纪念刘和珍君》', '1', '0');

-- ----------------------------
-- Table structure for `bbs_comment`
-- ----------------------------
DROP TABLE IF EXISTS `bbs_comment`;
CREATE TABLE `bbs_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '评论id',
  `comment` longtext COMMENT '评论的内容',
  `uid` int(11) NOT NULL COMMENT '用户id',
  `aid` int(11) NOT NULL COMMENT '评论所在的文章id',
  `date` varchar(18) DEFAULT NULL COMMENT '评论日期',
  `author` varchar(18) DEFAULT NULL COMMENT '评论发布的作者',
  `praise` int(11) DEFAULT '0' COMMENT '评论点赞',
  `blame` int(11) DEFAULT '0' COMMENT '评论倒彩',
  `from_content` longtext COMMENT '对这个内容进行回复',
  `from_nickname` varchar(18) DEFAULT NULL COMMENT '对这个人进行回复',
  `sid` int(11) DEFAULT NULL COMMENT '评论所在的版块的id',
  PRIMARY KEY (`id`),
  KEY `comment_user` (`uid`),
  KEY `comment_article` (`aid`),
  CONSTRAINT `comment_article` FOREIGN KEY (`aid`) REFERENCES `bbs_article` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `comment_user` FOREIGN KEY (`uid`) REFERENCES `bbs_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

