INSERT INTO `bbs_comment` VALUES ('4', '<p><span style=\"color: rgb(0, 0, 0);\">蝶恋花</span></p><p><span style=\"color: rgb(0, 0, 0);\">久客如初阑秀髫，</span></p><p><span style=\"color: rgb(0, 0, 0);\">俗思纷扰，</span></p><p><span style=\"color: rgb(0, 0, 0);\">凭栏立残照。</span></p><p><span style=\"color: rgb(0, 0, 0);\">秋风飒飒景萧萧，</span></p><p><span style=\"color: rgb(0, 0, 0);\">竹笛凄寞入缥缈。</span></p><p><span style=\"color: rgb(0, 0, 0);\">试遣浊酒慰寂寥，</span></p><p><span style=\"color: rgb(0, 0, 0);\">醺醺犹道，</span></p><p><span style=\"color: rgb(0, 0, 0);\">惆怅醉人倒。</span></p><p><span style=\"color: rgb(0, 0, 0);\">休说愁思欺年少，</span></p><p><span style=\"color: rgb(0, 0, 0);\">泪雨不住湿红绡。</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;（13年旧作）</span></p>', '5', '67', '2018-04-25 19:45', '张三', '0', '0', null, null, '21');

