DROP TABLE IF EXISTS `bbs_user`;
CREATE TABLE `bbs_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `username` varchar(18) NOT NULL COMMENT '用户名',
  `passwd` varchar(18) NOT NULL COMMENT '用户密码',
  `nickname` varchar(18) DEFAULT NULL COMMENT '用户昵称',
  `grade` varchar(8) DEFAULT NULL COMMENT '年级',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱地址',
  `sex` varchar(2) DEFAULT NULL COMMENT '性别',
  `birthday` varchar(18) DEFAULT NULL COMMENT '生日',
  `accuse` int(11) DEFAULT '0' COMMENT '举报标记，0记没有被举报，1记被举报',
  `ban` int(11) DEFAULT '0' COMMENT '封号标记，0记没有被封号，1记被封号',
  `position` varchar(11) DEFAULT '普通用户' COMMENT '用户权限，系统管理员，版主，普通用户',
  `online` int(11) DEFAULT '0' COMMENT '在线状态，0不离线，1在线',
  `avatar` varchar(255) DEFAULT NULL COMMENT '用户头像路径',
  `article_count` int(11) DEFAULT '0' COMMENT '发表文章数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

